/*Table structure for table `setup` */

DROP TABLE IF EXISTS `setup`;

CREATE TABLE `setup` (
  `setup_id` int(5) NOT NULL auto_increment,
  `company_name` varchar(250) default NULL,
  `company_timein` varchar(20) default NULL,
  `company_timeout` varchar(20) default NULL,
  `company_saturday` float default '0.5',
  `sl_graceperiod` int(3) default NULL,
  `allowlateslfiling` tinyint(1) default '0',
  PRIMARY KEY  (`setup_id`)
) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

/*Data for the table `setup` */

insert  into `setup`(`setup_id`,`company_name`,`company_timein`,`company_timeout`,`company_saturday`,`sl_graceperiod`,`allowlateslfiling`) values (1,'Infobahn','10:30','18:00',0.5,2,0);

/*Table structure for table `tbl_department` */

