/*Table structure for table `tbl_dispatch` */

DROP TABLE IF EXISTS `tbl_dispatch`;

CREATE TABLE `tbl_dispatch` (
  `dispatch_id` int(11) NOT NULL auto_increment,
  `dispatch_no` varchar(255) default NULL,
  `preferred_date` date default '0000-00-00',
  `requested_by` int(11) default NULL COMMENT 'Employee ID',
  `requested_date` date default '0000-00-00',
  `request_type` int(11) default NULL,
  `assigned_by` int(11) default NULL COMMENT 'FOR ADMIN',
  `assigned_date` datetime default '0000-00-00 00:00:00',
  `assign_type` int(11) default NULL,
  `dispatched_by` int(11) default NULL COMMENT 'Messenger or Truck ID',
  `dispatched_to` int(11) default NULL COMMENT 'Client ID',
  `dispatched_date` datetime default '0000-00-00 00:00:00',
  `time_start` time default '00:00:00',
  `time_completed` time default '00:00:00',
  `remarks_by_requestor` text,
  `remarks_by_dispatcher` text,
  `modified_date` timestamp NOT NULL default CURRENT_TIMESTAMP on update CURRENT_TIMESTAMP,
  `status_id` int(11) default NULL,
  `file_name` varchar(255) default NULL,
