/*Table structure for table `tbl_leaves` */

DROP TABLE IF EXISTS `tbl_leaves`;

CREATE TABLE `tbl_leaves` (
  `id` int(5) NOT NULL auto_increment,
  `employee_id` int(5) default NULL COMMENT 'profile_id',
  `no_days_leave` float(4,2) default '0.00' COMMENT '1=VL, 2=SL, 3=SUSPENDED, 4=AWOL',
  `dateapplied` date NOT NULL,
  `date_applied` int(20) default NULL,
  `leave_datefrom` date NOT NULL,
  `leave_date_from` int(20) default NULL,
  `leave_dateto` date NOT NULL,
  `leave_date_to` int(20) default NULL,
  `overtime_date` int(20) default NULL,
  `dateapproved_supervisor` date NOT NULL,
  `date_approved_supervisor` int(20) default NULL,
  `approve_supervisor` smallint(1) default '0' COMMENT '1=approve, 2=reject',
  `dateapproved_admin` date NOT NULL,
  `date_approved_admin` int(20) default NULL,
  `approve_admin` smallint(1) default '0' COMMENT '1=approve, 2=reject',
  `reason` text,
  `leave_tag` smallint(1) default '0' COMMENT '1=vacation_leave, 2=sick_leave, 3=offset leave, 4=emergency leave',
  `reject_reason` text,
  `is_delete` smallint(1) default '0',
  `withoutpay` smallint(1) default '0',
  `is_reset` smallint(1) NOT NULL,
  `call_log_id` int(20) NOT NULL COMMENT 'it leave come from call log',
  PRIMARY KEY  (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=1406 DEFAULT CHARSET=latin1;

