/*Table structure for table `tbl_schedules` */

DROP TABLE IF EXISTS `tbl_schedules`;

CREATE TABLE `tbl_schedules` (
  `s_id` int(5) NOT NULL auto_increment,
  `s_emp_id` int(5) default NULL,
  `purpose` int(2) NOT NULL,
  `date_created` timestamp NOT NULL default CURRENT_TIMESTAMP on update CURRENT_TIMESTAMP,
  `date_scheduled` date NOT NULL,
  `time_in` time default NULL,
  `time_out` time NOT NULL,
  `type` varchar(20) NOT NULL,
  `clientidno` int(11) NOT NULL,
  `contact_person` varchar(150) NOT NULL,
  `agenda` text NOT NULL,
  `status` tinyint(4) NOT NULL,
  `approved_by` int(11) NOT NULL,
  `time_tag` smallint(1) default NULL COMMENT '1=timein, 2=timeout',
  PRIMARY KEY  (`s_id`)
) ENGINE=MyISAM AUTO_INCREMENT=970 DEFAULT CHARSET=latin1;

